		Policy storage newPolicy = mapFarmlandToPolicy[_farmlandNumber];
        newPolicy.policyName = _policyName;
		newPolicy.farmerName = _farmerName;
        newPolicy.providerName = _providerName;
        newPolicy.farmlandNumber = _farmlandNumber;
		newPolicy.coverageLevel = _coverageLevel;
        newPolicy.farmerAddress = payable(msg.sender);
        newPolicy.providerAddress = _providerAddress;

		newPolicy.policyState = PolicyState.Purchased;		
        newPolicy.practiceRecords.push( _PracticeAddr);

        // mapProviderNameToAddress[_providerName] = newPolicy;

        // //Update farmerAddressList
        // if (whetherFarmerExist[msg.sender] == false) {
        //     farmerAddressList.push(payable(msg.sender));
        //     whetherFarmerExist[msg.sender] == true;
        // }

	    //Update mapFarmerToFarmland
		FarmlandByFarmer storage farmlandByFarmer = mapFarmerToFarmland[msg.sender];
		farmlandByFarmer.FarmlandIndexByFarmer.push(_farmlandNumber);
        farmlandByFarmer.farmerOwnFarmland[_farmlandNumber] = true;
		// Update mapProviderToFarmland
		FarmlandByProvider storage farmlandByProvider = mapProviderToFarmland[_providerAddress];
		farmlandByProvider.FarmlandIndexByProvider.push(_farmlandNumber);
        farmlandByProvider.providerOwnFarmland[_farmlandNumber] = true;

		// Send premium to provider
        _providerAddress.transfer(msg.value);

	}

