    // 7. view_claimed_policies
    function viewClaimedPolicy() public view returns (Policy[] memory claimedPolicyList) {
        require(isInsuranceProvider[msg.sender] == true, "Not authorized");
        FarmlandByProvider storage farmlandByProvider = mapProviderToFarmland[msg.sender];
        uint numOfFarmland = farmlandByProvider.FarmlandIndexByProvider.length;

        uint claimCount = 0;
        for (uint i = 0; i < numOfFarmland; i++) {
            Policy memory temp;
            if (temp.policyState == PolicyState.Claimed) {
                claimCount++;
            }      
        }
        Policy [] memory policies = new Policy [](claimCount);
        uint j = 0;
        for (uint i = 0; i < numOfFarmland; i++) {
            Policy memory temp;
            if (temp.policyState == PolicyState.Claimed) {
                policies[j] = temp;
                j++;
            }      
        }
        return policies;
    }  

    // 8. assign_claim_to_adjuster
    function assignClaim (uint _farmlandNumber, string memory _adjusterName) public returns (bool _isSuccess) {
