        // FarmlandByProvider storage farmlandByProvider = mapProviderToFarmland[msg.sender];
        // require(farmlandByProvider.providerOwnFarmland[_farmlandNumber] == true, "You do not manage this farmland");

        // Assign workload to an adjuster
        address _adjusterAddress = mapAdjusterNameToAddress[_adjusterName];
        AdjusterWorkload storage adjusterWorkload = mapAdjusterToWorkload[_adjusterAddress];
        adjusterWorkload.ClaimedFarmland.push(_farmlandNumber);
        // Set policy state to Dispatched
        Policy storage policy = mapFarmlandToPolicy[_farmlandNumber];
        policy.policyState = PolicyState.Dispatched;
        return true;
    }

