    // 1. view_workload
    function viewWorkload () public view returns (Policy[] memory _myWork) {
        require(isInsuranceAdjuster[msg.sender] == true, "Not authorized");
        AdjusterWorkload memory workload = mapAdjusterToWorkload[msg.sender];
        uint len = workload.ClaimedFarmland.length;
        Policy [] memory myWork = new Policy [](len);
        for (uint i = 0; i < len; i++) {
            Policy memory temp = mapFarmlandToPolicy[workload.ClaimedFarmland[i]];
            myWork[i] = temp;
        }
        return myWork;
    }

    // 2. add_investigation_result
    function addInvestigationResult(uint _farmlandNumber, string memory _res) public returns (bool _isSuccess) {
        require(isInsuranceAdjuster[msg.sender] == true, "Not authorized");
        AdjusterWorkload storage workload = mapAdjusterToWorkload[msg.sender];
        uint len = workload.ClaimedFarmland.length;

        // identify farmland index in ClaimedFarmland array
        uint index = 0;
        for (uint i = 0; i < len; i++) {
            if(workload.ClaimedFarmland[i] == _farmlandNumber) {
                index = i;
                break;
            }
        }

        // delete this farmland from workload array
        if (index == 0 || index == len - 1){
            workload.ClaimedFarmland.pop();
        } else {
            for (uint i = index; i < len - 1; i++) {
                workload.ClaimedFarmland[i] = workload.ClaimedFarmland[i+1];
                workload.ClaimedFarmland.pop();
            }
        }

        Policy storage policy = mapFarmlandToPolicy[_farmlandNumber];
        // upload investigation result
        policy.investigationContent = _res;
        // change policy state to finished
        policy.policyState = PolicyState.Finished;
        return true;
    }


